import React from 'react';
import './App.css';
import Particles from "react-particles-js";

function App() {
  return (
    <div className="App">
      <Particles 
          params={{
            polygon: {
                enable: true,
                type: 'inside',
                move: {
                    radius: 10
                },
                url: 'path/to/svg.svg'
            }
        }} />
      <h1>Maris-Angelique</h1>
      <h3>Full Stack Web Developer</h3>
    </div>
  );
}

export default App;
